import { useState } from 'react';

const LiftingState = props => {
    const [persons, setpersons] = useState([]);

    const toList = (item, index) => {
        return <li key={index}>{item}</li>;
    }

    return (
        <div>
            <p>hgelll</p>
            <ul>
                {persons.map(toList)}
            </ul>

        </div>
    );
}

export default LiftingState;
